                <div>

                    <Button clas="filtre-tous btn  me-2 btn-outline-secondary btn">
                        h5
                    </Button>
                    <Button clas="filtre-refuse btn btn-outline-danger btn me-2"></Button>
                    <Button clas="filtre-accepte btn btn-outline-success btn"></Button>
                </div>

            </div>
        </div>
    );
}

export default Proposition;
